import React from 'react';
import { Link } from 'react-router-dom';
import HomeCarousel from '../../HomeCarousel';
import Categories from './Categories';

function Home() {
    return (
        <div>
            <HomeCarousel />
            <div className="row">
            <div className="col-lg-4">
                <img src={`http://localhost:8000/photos/mario.jpg`} alt="Avatar" width="200px" border-radius="50%" />
                <h2>Mario</h2>
                <p>Naš web admin zaslužan je za tehničku podršku i promociju Vaših proizvoda.</p>
            </div>
            <div className="col-lg-4">
                <img src={`http://localhost:8000/photos/ana.jpg`} alt="Avatar"  width="200px" border-radius="50%" />
                <h2>Ana</h2>
                <p>Pružamo Vam odličnu korisničku podršku kako bi Vam olakšali korištenje
                    Aplikacije <Link to="/home">Moja tržnica,</Link> a to je zadatak naše Ane.

                </p>
            </div>
            <div className="col-lg-4">
                <img src={`http://localhost:8000/photos/toni.jpg`} alt="Avatar" width="200px" border-radius="50%" />
                <h2>Toni</h2>
                <p>Brine se da Vaša narudžba stigne u što kraćem roku na Vašu adresu.</p>
            </div>
            </div>
            <Categories />
        </div>

    );
}

export default Home;
